import React from 'react'
import { Grid,ButtonBase, makeStyles, Typography, Paper } from '@material-ui/core';
import { Link } from 'react-router-dom';


const useStyles = makeStyles((theme) => ({
    transparent:{ 
        background:'#00ff0000',
        color:'#00ff0000'
      },
    
    image:{
        display: 'block',
        maxWidth: '100%',
        maxHeight: '100%'
    },

    nametag:{
        fontSize: 'subtitle1',
        textAlign: 'center'
    },

    pricetag:{
        color: '#FF7F50',
        fontSize: '14px',
        textAlign: 'right'
    },

    wrap:{
        alignContent:'center',
        width:'110',
        height:'128'
    }

}))

export default function GridTool() {
    const classes = useStyles();
    return (
        <Grid item xs={6} sm={3} >
            <div style={{width : 150, height : 250, margin: '10px auto', marginBottom:'3', marginTop:'10'}}>
                <Grid item>
                    <Paper className={classes.wrap}>
                        <ButtonBase className={classes.image} component={Link} to ='/rooms'>
                        <img className={classes.image} alt='complex' src='https://ifh.cc/g/2JYFaB.jpg' width='150' height='140'/>
                        </ButtonBase>
                    </Paper>
                </Grid>
                <Grid item>
                    <Typography className={classes.nametag}>
                        오늘의 도서
                    </Typography>
                </Grid>
                <Grid item>
                    <Typography variant='body2' color='textSecondary'>
                        저자 : 윤석준
                    </Typography>
                </Grid>
                <Grid item>
                    <Typography variant='body2' color='textSecondary'>
                        출판사 : DolDaRi
                    </Typography>
                </Grid>
                <Grid item>
                    <Typography className={classes.pricetag}>
                        12000원
                    </Typography>
                </Grid>
            </div>
        </Grid>
    )}
